import SignupForm from '../../components/auth/SignupForm';
import AuthPage from '../../components/auth/AuthPage';
import './AuthPage.css';

const SignupPage = () => {
  return (
    <AuthPage isLogin={false}>
      <SignupForm />
    </AuthPage>
  );
};

export default SignupPage;
